// src/index.js
import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import { GameProvider } from './context/GameContext';

const container = document.getElementById('root');
const root = ReactDOM.createRoot(container);

root.render(
  <GameProvider>
    <App />
  </GameProvider>
);
